import{_ as n,C as e,o as s,c as l,a9 as d,E as o,w as c}from"./chunks/framework.DJOAND2c.js";const b=JSON.parse('{"title":"Заголовочный Символ (16-битные Метаданные Сжатия)","description":"","frontmatter":{},"headers":[],"relativePath":"ru/internals/header.md","filePath":"ru/internals/header.md","lastUpdated":1769872182000}'),i={name:"ru/internals/header.md"};function g(h,t,p,_,x,u){const r=e("HeaderCharacter"),a=e("ClientOnly");return s(),l("div",null,[t[0]||(t[0]=d('<h1 id="заголовочныи-символ-16-битные-метаданные-сжатия" tabindex="-1">Заголовочный Символ (16-битные Метаданные Сжатия) <a class="header-anchor" href="#заголовочныи-символ-16-битные-метаданные-сжатия" aria-label="Permalink to &quot;Заголовочный Символ (16-битные Метаданные Сжатия)&quot;">​</a></h1><p>Каждая JSSC-сжатая string начинается с одного <strong>UTF-16 символа</strong>, который хранит все метаданные сжатия, необходимые для расжатия.</p><p>Такой символ называется <strong>Заголовочный Символ</strong>.</p><p>Он содержит Индекс Режима Сжатия, флаги и другие параметры. Все эти данные полностью помещаются в его <strong>16 битов</strong>, позволяя остальной string содержать только сами сжатые данные.</p><h2 id="стандартная-компоновка-битов" tabindex="-1">Стандартная Компоновка Битов <a class="header-anchor" href="#стандартная-компоновка-битов" aria-label="Permalink to &quot;Стандартная Компоновка Битов&quot;">​</a></h2><p>Не смотря на то что каждый режим сжатия может интерпретировать 16 битов по-своему, большинство режимов соответствуют <strong>стандартной компоновке</strong>.</p><p>Вместо того чтобы рассматривать заголовочный символ как четыре полубайта, JSSC группирует биты в <strong>блоки</strong>:</p>',7)),o(a,null,{default:c(()=>[o(r,{translate:{Bits:"Биты",Blocks:"Блоки",Code:"Код"}})]),_:1}),t[1]||(t[1]=d('<blockquote><table tabindex="0"><thead><tr><th style="text-align:right;">Название</th><th style="text-align:center;">Тип</th><th>Значение / Стандартное Использование</th></tr></thead><tbody><tr><td style="text-align:right;">Код #1</td><td style="text-align:center;">Число</td><td>Индекс Режима Сжатия</td></tr><tr><td style="text-align:right;">Код #2</td><td style="text-align:center;">Число</td><td>(Используется режимом сжатия)</td></tr><tr><td style="text-align:right;">Код #3</td><td style="text-align:center;">Число</td><td>Тип данных / JUSTC использован? / BeginID</td></tr><tr><td style="text-align:right;">i?</td><td style="text-align:center;">Переменная</td><td>RLE использован на входных данных?</td></tr><tr><td style="text-align:right;">o?</td><td style="text-align:center;">Переменная</td><td>RLE использован на выходных данных?</td></tr><tr><td style="text-align:right;">s?</td><td style="text-align:center;">Переменная</td><td>Последовательности найдены и сжаты?</td></tr><tr><td style="text-align:right;">b?</td><td style="text-align:center;">Переменная</td><td>BeginID использован? (<code>false</code> = Код #3 это BeginID)</td></tr></tbody></table></blockquote><h2 id="нестандартные-компоновки" tabindex="-1">Нестандартные Компоновки <a class="header-anchor" href="#нестандартные-компоновки" aria-label="Permalink to &quot;Нестандартные Компоновки&quot;">​</a></h2><p><strong>Стандартная компоновка не обязательна</strong>.</p><p>Некоторые режимы используют части заголовочного символа не по стандартному назначению для достижения лучшей эффективности сжатия.</p><p>Такие случаи задокументированы в страницах этих режимов сжатия.</p><h2 id="индекс-режима-сжатия-и-код-1" tabindex="-1">Индекс Режима Сжатия и <code>Код #1</code> <a class="header-anchor" href="#индекс-режима-сжатия-и-код-1" aria-label="Permalink to &quot;Индекс Режима Сжатия и `Код #1`&quot;">​</a></h2><p><code>Код #1</code> <strong>не всегда</strong> соответствует индексу режима сжатия. JSSC кодирует индекс режима сжатия в <strong>весь Заголовочный Символ</strong>.</p><blockquote><p>Например, когда <code>Код #1</code> равен <code>00</code>, но <code>Код #2</code> не равен <code>00</code> — это соответствует <strong>Режиму Сжатия <code>06</code></strong>, а не <code>00</code>.</p><p>В данном случае это происходит из-за того, что <a href="./modes/06">Режим Сжатия <code>06</code></a> сохраняет либо <code>06</code>, либо <code>00</code> в <code>Код #1</code>, смотря на тип входных данных.</p><p>Соответственно, когда <code>Код #1</code> равен <code>00</code> <strong>и</strong> <code>Код #2</code> тоже равен <code>00</code> — это соответствует Режиму Сжатия <code>00</code>.</p></blockquote>',8))])}const m=n(i,[["render",g]]);export{b as __pageData,m as default};
